import {Card} from "react-bootstrap";


export default function SongBox({song}){
    return (
        <>
            <Card style={{ width: '200px', height: '200px' }} className="d-flex">
                <Card.Body>
                    <Card.Title>{song.title}</Card.Title>
                    <Card.Subtitle className="mb-2 text-muted">song.artists</Card.Subtitle>

                </Card.Body>
            </Card>
        </>
    )

}
